pub enum LiteralKind {
    Int {
        base: Base,
        empty_int: bool,
    },
    Float {
        base: Base,
        empty_exponent: bool,
    },
    Char {
        terminated: bool,
    },
    Byte {
        terminated: bool,
    },
    Str {
        terminated: bool,
    },
    ByteStr {
        terminated: bool,
    },
    RawStr {
        n_hashes: usize,
        started: bool,
        terminated: bool,
    },
    RawByteStr {
        n_hashes: usize,
        started: bool,
        terminated: bool,
    },
}
